import React from 'react';
import '../App.css';
import { Link, Router } from 'react-router-dom';

function Navbar(){

    return(
        <div className= "navbar">
           <nav>
              <div className="navigelements"> 
                   <ul>
                     <a className ="india" href= "/#">Covid-News-Updates</a>
                     <a className ="india" href= "https://www.covid19india.org/">Indian-Covid-Cases</a>
                   </ul>
             </div>
           </nav>
        </div>
    );
}
export default Navbar;
